import React from 'react';
import ProductCard from './ProductCard';

function Dashboard() {
  const products = [
    {
      id: 1,
      name: 'Đồng Hồ Rolex',
      description: 'Chất liệu thép không gỉ, chống nước 100m.',
      price: '250,000,000',
      image: 'https://thethaominhphu.com/wp-content/uploads/2017/04/dong-ho-bam-giay-pc894.jpg',
    },
    {
      id: 2,
      name: 'Đồng Hồ Casio',
      description: 'chống nước .',
      price: '2,500,000',
      image: 'https://bizweb.dktcdn.net/100/448/180/files/dong-ho-nam-hanboro-rong-may-tu-dong-day-da-vo-silver-44mm-3.jpg?v=1710578806059',
    },
        {
      id: 2,
      name: 'Đồng Hồ Casio',
      description: 'chống nước.',
      price: '2,500,000',
      image: 'https://img.pikbest.com/origin/06/21/72/20wpIkbEsTHaJ.jpg!f305cw',
    },
        {
      id: 1,
      name: 'Đồng Hồ Rolex',
      description: 'Chất liệu thép không gỉ, chống nước 100m.',
      price: '250,000,000',
      image: 'https://product.hstatic.net/1000162035/product/z2604926224993_661a1b964bda49839588aa379e6e1857_fee9425e97ca4346a6f9b6c80d2dfb75_1024x1024.jpg',
    },
       {
      id: 1,
      name: 'Đồng Hồ Rolex',
      description: 'Chất liệu thép không gỉ, chống nước 100m.',
      price: '250,000,000',
      image: 'https://down-vn.img.susercontent.com/file/vn-11134207-7ras8-m4h78tiq61vrad_tn.webp',
    },
       {
      id: 1,
      name: 'Đồng Hồ Rolex',
      description: 'Chất liệu thép không gỉ, chống nước 100m.',
      price: '250,000,000',
      image: 'https://www.68timelux.com/uploads/images/Hinh-anh-dong-ho-Hublot.jpg',
    },
       {
      id: 1,
      name: 'Đồng Hồ Rolex',
      description: 'Chất liệu thép không gỉ, chống nước 100m.',
      price: '250,000,000',
      image: 'https://img.vuahanghieu.com/unsafe/0x0/left/top/smart/filters:quality(90)/https://admin.vuahanghieu.com/upload/news/content/2024/01/cach-ve-sinh-dong-ho-hublot-dung-cach-1-jpg-1705376008-16012024103328.jpg',
    },
  ];

  return (
    <div>
      <h1>Dashboard Quản Lý Đồng Hồ</h1>
      <div style={{ display: 'flex', flexWrap: 'wrap' }}>
        {products.map((product) => (
          <ProductCard key={product.id} product={product} />
        ))}
      </div>
    </div>
  );
}

export default Dashboard;
